import React from 'react';

const buttonColor = (props) => {
    return (
        <div>
            <input 
                className="form-control"
                type="text" 
                onChange={props.change} 
                value={props.name} 
                placeholder={props.name}
                name="buttonColor"
            />
        </div>
    )
}

export default buttonColor;
